package com.sk.admin.web.view;import java.util.List;import javax.faces.bean.ManagedBean;import javax.faces.bean.ManagedProperty;import javax.faces.bean.ViewScoped;import com.sk.domain.Order;import com.sk.service.OrderService;@ViewScoped@ManagedBeanpublic class OrdersView extends BaseView {	private static final long serialVersionUID = -3028675164123618741L;		private Order selectedOrder;		@ManagedProperty("#{orderService}")	private transient OrderService orderService;	public void setOrderService(OrderService orderService) {		this.orderService = orderService;	}	public List<Order> getAll() {		return orderService.getAll();	}	public Order getSelectedOrder() {		return selectedOrder;	}	public void setSelectedOrder(Order selectedOrder) {		this.selectedOrder = selectedOrder;	}		}